import React from 'react';
import SideBarColumn from './SideBarColumn';
//import './SideBar.css';
import { ExpandMoreOutlined } from '@material-ui/icons';
import SearchIcon from '@material-ui/icons/Search';
import HomeIcon from '@material-ui/icons/Home';
import ExploreIcon from '@material-ui/icons/Explore';
import FavoriteBorderIcon from '@material-ui/icons/FavoriteBorder';
import AddBoxIcon from '@material-ui/icons/AddBox';
import VideoLibraryIcon from '@material-ui/icons/VideoLibrary';
import { BsMessenger} from 'react-icons/bs';


function Sidebar() {


  return (
    <div className="sideBar">

      <SideBarColumn Icon={HomeIcon} title="COVID-19 Information Center" />
      <SideBarColumn Icon={SearchIcon} title="Pages" />
      <SideBarColumn Icon={ExploreIcon} title="Friends" />
      <SideBarColumn Icon={BsMessenger} title="Messanger" />
      <SideBarColumn Icon={FavoriteBorderIcon} title="Marketplace" />
      <SideBarColumn Icon={AddBoxIcon} title="Videos" />
      <SideBarColumn Icon={ExpandMoreOutlined} title="More" />
      <SideBarColumn src={"https://static.thenounproject.com/png/1559154-200.png"} title= "Vikash"/>
    </div>
  );
}

export default Sidebar;
